using Microsoft.Owin.Testing;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using MrCasting.Domain.DTO;
using MrCasting.Domain.Interfaces.Repositories;
using MrCasting.Infra.Data.Repositories;
using MrCasting.Services.WebApi.Test.Setup;
using MrCasting.Testing.Helpers.EntitiesSamples;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Net.Http;
using System.Text;
using System.Threading.Tasks;

namespace MrCasting.Services.WebApi.Test.Tests
{
    [TestClass]
   public class FotoIntegrationDBTest
    {
        private static TestServer _server;
        private static IFotoRepository fotoRepository = new FotoRepository(new Infra.Data.Contexts.GeneralContext());

        public FotoIntegrationDBTest()
        {
            _server = TestServer.Create<StartupDB>();
        }

        [ClassCleanup()]
        public static void TearDown()
        {
            _server.Dispose();
        }

        [TestMethod]
        public void FotoController_Insert_RetornaStatusSucesso()
        {
            FotoDTO fotoDTO = FotoSamples.CriarFotoDTO();
            fotoDTO.Foto = "";
            fotoDTO.NomeFoto = "Teste 2";
            fotoDTO.IdCandidato = 1;
           
            var response = _server.HttpClient.PostAsJsonAsync("api/Foto", fotoDTO).Result;

            Assert.IsTrue(response.IsSuccessStatusCode);
        }

    }
}
